import React from "react";
import ReactExport from 'react-data-export';
import { Button } from 'reactstrap';

const ExcelFile = ReactExport.ExcelFile;
const ExcelSheet = ReactExport.ExcelFile.ExcelSheet;
const ExcelColumn = ReactExport.ExcelFile.ExcelColumn;


class ExportReport extends React.Component {
  render() {
    const { dataSet = null } = this.props;
    return (
      <div>
        <ExcelFile element={<Button style={{backgroundColor:'#008c9a', borderColor:'#008c9a'}}><b>Export Report</b></Button>}>
          <ExcelSheet data={dataSet} name="Export Report">
            <ExcelColumn label="NO" value="index"/>
            <ExcelColumn label="BOOKING ID" value="booking_code"/>
            <ExcelColumn label="DATE" value="date" numFmt="m/dd/yy"/>
            <ExcelColumn label="RUTE" value="route"/>
            <ExcelColumn label="AMOUNT" value="total_amount"/>
            <ExcelColumn label="STATUS" value="status"/>
          </ExcelSheet>
        </ExcelFile>
      </div>
    );
  }
}
export default ExportReport;
